import React from 'react'

const AssignedProgressions = ({progressions, reflections, videos}) => {
  return (
    <>
      {progressions.map((prog, index) => (
        <StudentProgression
                  key={index}
                  progression={prog}
                  reflections={reflections}
                  videos={videos}/>
      ))}
    </>
  )
}

export default AssignedProgressions
